import React, { useRef } from "react";
import Input from "../UI/Input";

const OrderForm = () => {
  const nameRef = useRef();
  const addressRef = useRef();
  const phoneRef = useRef();

  return (
    <form>
      <Input
        ref={nameRef}
        lable="Name : "
        input={{
          type: "string",
        }}
      />
      <Input
        ref={addressRef}
        lable="Address : "
        input={{
          type: "string",
        }}
      />
      <Input
        ref={phoneRef}
        lable="Phhone : "
        input={{
          type: "number",
        }}
      />
      <button>+ Add</button>
    </form>
  );
};

export default OrderForm;
